import React from "react";
import {
    Router,
    Switch,
    Route,
} from "react-router-dom";

import Search from './sections/search/search';
import ProductList from  './sections/product-list/product-list';
import ProductDetail from './sections/detail-products/detail-products';

const pathRoutes = () => {

    return (
        <Router history={ history }>
            <header>
                <Search></Search>
            </header>
            <switch>
                <Route exact path='/items' component={ ProductList }></Route>
                <Route exact path='/items/:id' component={ ProductDetail }></Route>
            </switch>
        </Router>
    )

	/* [`/`]: {component: Search},
    [`/items/search=`]: {component: ProductList},
    [`/items/:id`]: {component: ProductDetail} */
};

export {
	pathRoutes as routes,
};
